// 524. 通过删除字母匹配到字典里最长单词
// 给你一个字符串 s 和一个字符串数组 dictionary ，找出并返回 dictionary 中最长的字符串，该字符串可以通过删除 s 中的某些字符得到。

// 如果答案不止一个，返回长度最长且字母序最小的字符串。如果答案不存在，则返回空字符串。

// 示例 1：

// 输入：s = "abpcplea", dictionary = ["ale","apple","monkey","plea"]
// 输出："apple"
// 示例 2：

// 输入：s = "abpcplea", dictionary = ["a","b","c"]
// 输出："a"

// 提示：
// 1 <= s.length <= 1000
// 1 <= dictionary.length <= 1000
// 1 <= dictionary[i].length <= 1000
// s 和 dictionary[i] 仅由小写英文字母组成

/**
 * @param {string} s
 * @param {string[]} dictionary
 * @return {string}
 */
var findLongestWord = function (s, dictionary) {
  let res = '';
  for (let i = 0; i < dictionary.length; i++) {
    let str = s;
    let word = dictionary[i];
    if (word.length > str.length) break;
    while (word && str.includes(word.charAt(0))) {
      str = str.slice(str.indexOf(word.charAt(0)) + 1);
      word = word.slice(1);
    }
    if (!word) {
      console.log('可选答案', dictionary[i]);
      if (dictionary[i].length >= res.length) {
        if (dictionary[i].length > res.length) {
          res = dictionary[i]
        } else {
          res = dictionary[i] < res ? dictionary[i] : res;
        }
      }
    }
  }
  return res;
};

console.log(findLongestWord('abpcplea', ["ale", "apple", "monkey", "plea"]));
console.log(findLongestWord('abce', ["abe", "abc"]));
console.log(findLongestWord('abpcplea', ['a', 'b', 'c']));
